import { useState } from "react";

function Ocultar() {
  const [ocultar, setOcultar] = useState(true);
  const onClick = () => {
    setOcultar(false);
  };
  return (
    <div>
      <input type="submit" value="Search" onClick={onClick} />
      {ocultar ? <Results /> : null}
    </div>
  );
}

const Results = () => <h1>PRUEBA</h1>;
export default Ocultar;
